import React from "react";
import { useRef } from "react";
import { NavLink } from "react-router-dom";
import star from '../img/star.png'

const ArchiveJournalEntry = (props) => {    
    return (
        <div className="archived-entry-container">
            <img className="archived-entries-star" src={star}></img>
            <p className="archived-entries-conclusion">{props.conclusion}</p>
        </div>
    )
}

export default ArchiveJournalEntry
